-- Function to refresh overlays (Blizzard_SharedMapDataProviders\MapExplorationDataProvider)
local overlayTextures, TileExists = {}, {}

local function RefMap(self, fullUpdate)
    wipe(overlayTextures)

    local mapID = WorldMapFrame.mapID
    if not mapID then return end

    local artID = C_Map_GetMapArtID(mapID)
    if not artID or not zones[artID] then return end

    local LeaMapsZone = zones[artID]

    -- Store already explored tiles in a table so they can be ignored
    local exploredMapTextures = C_MapExplorationInfo_GetExploredMapTextures(mapID)
    if exploredMapTextures then
        for _, exploredTextureInfo in ipairs(exploredMapTextures) do
            local key = exploredTextureInfo.textureWidth ..
                    ":" .. exploredTextureInfo.textureHeight .. ":" .. exploredTextureInfo.offsetX .. ":" .. exploredTextureInfo.offsetY
            TileExists[key] = true
        end
    end

    self.layerIndex = self:GetMap():GetCanvasContainer():GetCurrentLayerIndex()
    local layers = C_Map_GetMapArtLayers(mapID)
    local layerInfo = layers and layers[self.layerIndex]
    if not layerInfo then return end
    local TILE_SIZE_WIDTH = layerInfo.tileWidth
    local TILE_SIZE_HEIGHT = layerInfo.tileHeight

    -- Show textures if they are in database and have not been explored
    for key, files in pairs(LeaMapsZone) do
        if not TileExists[key] then
            local width, height, offsetX, offsetY = strsplit(":", key)
            local fileDataIDs = { strsplit(",", files) }
            local numTexturesWide = ceil(width / TILE_SIZE_WIDTH)
            local numTexturesTall = ceil(height / TILE_SIZE_HEIGHT)
            local texturePixelWidth, textureFileWidth, texturePixelHeight, textureFileHeight
            for j = 1, numTexturesTall do
                if (j < numTexturesTall) then
                    texturePixelHeight = TILE_SIZE_HEIGHT
                    textureFileHeight = TILE_SIZE_HEIGHT
                else
                    texturePixelHeight = mod(height, TILE_SIZE_HEIGHT)
                    if (texturePixelHeight == 0) then
                        texturePixelHeight = TILE_SIZE_HEIGHT
                    end
                    textureFileHeight = 16
                    while (textureFileHeight < texturePixelHeight) do
                        textureFileHeight = textureFileHeight * 2
                    end
                end
                for k = 1, numTexturesWide do
                    local texture = self.overlayTexturePool:Acquire()
                    if (k < numTexturesWide) then
                        texturePixelWidth = TILE_SIZE_WIDTH
                        textureFileWidth = TILE_SIZE_WIDTH
                    else
                        texturePixelWidth = mod(width, TILE_SIZE_WIDTH)
                        if (texturePixelWidth == 0) then
                            texturePixelWidth = TILE_SIZE_WIDTH
                        end
                        textureFileWidth = 16
                        while (textureFileWidth < texturePixelWidth) do
                            textureFileWidth = textureFileWidth * 2
                        end
                    end
                    texture:SetSize(texturePixelWidth, texturePixelHeight)
                    texture:SetTexCoord(0, texturePixelWidth / textureFileWidth, 0, texturePixelHeight / textureFileHeight)
                    texture:SetPoint("TOPLEFT", offsetX + (TILE_SIZE_WIDTH * (k - 1)), -(offsetY + (TILE_SIZE_HEIGHT * (j - 1))))
                    texture:SetTexture(tonumber(fileDataIDs[((j - 1) * numTexturesWide) + k]), nil, nil, "TRILINEAR")
                    texture:SetDrawLayer("ARTWORK", -1)
                    texture:SetShown(SavedStatsPerChar.removeFog or false)
                    if fullUpdate then
                        self.textureLoadGroup:AddTexture(texture)
                    end
                    tinsert(overlayTextures, texture)
                end
            end
        end
    end
end

-- Reset texture color and alpha
local function TexturePool_ResetVertexColor(pool, texture)
    texture:SetVertexColor(1, 1, 1)
    texture:SetAlpha(1)
    return TexturePool_HideAndClearAnchors(pool, texture)
end

-- Create checkbox
local frame = CreateFrame("CheckButton", "FogCheckBox", WorldMapFrame.BorderFrame, "OptionsCheckButtonTemplate")
frame:SetPoint("TOPRIGHT", -270, -3.5)
frame:SetSize(18, 18)
frame:SetFrameLevel(8)
frame:SkinCheckBox()

frame.f = frame:CreateFontString(nil, "OVERLAY", "GameFontNormal")
frame.f:SetFont(GameFontNormal:GetFont(), 14, "0")
frame.f:SetPoint("LEFT", frame, "RIGHT", 0, 0)
frame.f:SetText(L.MAP_REMOVEFOG)

RunScript("C_Map.GetMapArtLayers = C_Map.GetMapArtLayers")

for pin in WorldMapFrame:EnumeratePinsByTemplate("MapExplorationPinTemplate") do
    hooksecurefunc(pin, "RefreshOverlays", RefMap)
    pin.overlayTexturePool.resetterFunc = TexturePool_ResetVertexColor
end

-- Handle clicks
frame:SetScript("OnClick", function()
    SavedStatsPerChar.removeFog = frame:GetChecked()

    for i = 1, #overlayTextures do
        overlayTextures[i]:SetShown(SavedStatsPerChar.removeFog)
    end
end)

-- Set checkbox state
frame:SetScript("OnShow", function()
    if SavedStatsPerChar.removeFog == true then
        frame:SetChecked(true)
    else
        frame:SetChecked(false)
    end
end)
